import React, { Component } from "react";
import { connect } from "react-redux";
import { addToken } from "../js/actions/index";


export class Test extends Component {
  constructor() {
    super();
  }
  componentDidMount() {
    // calling the new action creator
    this.props.addToken();
  }
  render() {
    return null;
  }
}
export default connect(
  null,
  { addToken }
)(Test);
